/**
 * Parse Options
 * @typedef {Object} ParseOptions
 * @property {boolean} [options.unique=true] Whether the arguments should be considered unique or not
 * @property {boolean} [options.parseFlags=true] Parse flags
 * @property {boolean} [options.parseArgs=true] Parse args
 * @property {boolean} [options.typeCoerce=false] Try to coerce strings that could be numbers or booleans to them
 * @property {string} [options.prefix=-] Set the prefix dashargs looks for before flags/args
 */

/**
 * Strip Options
 * @typedef {Object} StripOptions
 * @property {boolean} [options.removeWhitespace=true]
 * @property {boolean} [options.removeFlags=true]
 * @property {boolean} [options.removeArgs=true]
 * @property {string} [options.prefix=-] Set the prefix dashargs looks for to strip args/flags
 */
